    <div className="container">
      <div className="button-container">
        <button onClick={() => displayFilterForm()} className="button">
          Filter
        </button>
        <button onClick={() => displaySalaryForm()} className="button">
          Add Salary +
        </button>
      </div>
      {!salaryFormStatus ? (
        <div></div>
      ) : (
        <div className="box">
          <h2>salary form</h2>
        </div>
      )}
      {!filterFormStatus ? (
        <div></div>
      ) : (
        <div className="box">
          <h2>filter form</h2>
        </div>
      )}
    </div>
  );
};
